(()=>{const e=sessionStorage.getItem("token");fetch("http://localhost:8000/api/dioses/obtener/tartaro",{headers:{Authorization:`Bearer ${e}`}}).then((e=>{if(!e.ok)throw new Error(`HTTP error! status: ${e.status}`);return e.json()})).then((e=>{const t=document.querySelector("#miTabla tbody");t.innerHTML="",e.forEach((e=>{const o=document.createElement("tr"),r=document.createElement("td");r.textContent=e.nombre;const n=document.createElement("td");n.textContent=e.correo,o.appendChild(r),o.appendChild(n),t.appendChild(o)}))})).catch((e=>console.error("Error al obtener los datos:",e)))})();